ns1:Requirement.ns1:Description:
[In Response] This attribute[ErrorCode] MUST NOT be present if all of the followings are true: 
1.The Url attribute of the corresponding Request element does exist; 
2.The Url attribute of the corresponding Request element is not an empty string; 
3.No exceptions occurred during the processing of a subrequest that was not entirely handled by the subrequest processing logic.

[In ResponseVersion] This attribute[ErrorCode] MUST NOT be present if all of the followings are true: 
1.The RequestVersion element is not missing from the Body element of the SOAP request message; 
2.The Version attribute of the RequestVersion element of the request message has not a value that is less than 2; 
3.The protocol server identified by the WebUrl attribute of the ResponseCollection element does exist; 
4.The protocol server identified by the WebUrl attribute of the ResponseCollection element is available; 
5.The user does have permission to issue a cell storage service request to the file identified by the Url attribute of the Request element.

[In LockAndCoauthRelatedErrorCodeTypes] MultipleClientsInCoauthSession indicates an error when all of the following conditions are true:
1.A coauthoring subrequest of type "Convert to exclusive lock" is requested on a file;
2.There is more than one client in the current coauthoring session for that file;
3.The ReleaseLockOnConversionToExclusiveFailure attribute specified as part of the subrequest is set to false.

[In LockAndCoauthRelatedErrorCodeTypes] MultipleClientsInCoauthSession indicates an error when all of the following conditions are true:
1.A schema lock subrequest of type "Convert to exclusive lock" is requested on a file;
2.There is more than one client in the current coauthoring session for that file;
3.The ReleaseLockOnConversionToExclusiveFailure attribute specified as part of the subrequest is set to false.

[In CoauthSubRequestDataType] ReleaseLockOnConversionToExclusiveFailure: A Boolean value that specifies to the protocol server whether the server is allowed to remove the ClientID entry associated with the current client in the File coauthoring tracker, provided that all of the following conditions are true:

The type of coauthoring subrequest is "Convert to an exclusive lock";

The conversion to an exclusive lock failed.

[In SchemaLockSubRequestDataType] ReleaseLockOnConversionToExclusiveFailure: A Boolean value that specifies to the protocol server whether the server is allowed to remove the ClientID entry associated with the current client in the File coauthoring tracker, provided that all of the following conditions are true:
The type of the schema lock subrequest is "Convert to an Exclusive Lock";
The conversion to an exclusive lock failed.

[In Common Message Processing Rules and Events][The protocol server MUST follow the following common processing rules for all types of subrequests] The protocol server MAY return an error code value set to "RequestNotSupported" for a cell storage service subrequest if the following conditions are all true: 

The protocol client sent a coauthoring subrequest;
The protocol server supports shared locking with tracking of the coauthoring transition;
The coauthoring administrator setting for the server is turned off.

[In Coauth Subrequest] The protocol server uses the ClientID attribute sent in a coauthoring subrequest to do the following:

1.Uniquely identify each client;

2.Keep track of each client and its timeout on the shared lock for the file;

3.Decide when to release the shared lock on the file.

[In Join Coauthoring Session] The protocol server returns an error code value set to "NumberOfCoauthorsReachedMax" when all of the following conditions are true: 
1.The maximum number of coauthorable clients allowed to join a coauthoring session to edit a coauthorable file has been reached;
2.The current client is not allowed to edit the file because the limit has been reached.

[In Convert to Exclusive Lock] The protocol server does the following two operations as an atomic operation:

1.The conversion of the shared lock to an exclusive lock;

2.The deletion of coauthoring session.

[In Convert to Exclusive Lock] The protocol server returns an error code value set to "ExitCoauthSessionAsConvertToExclusiveFailed" when the following conditions are both true:
1.The ReleaseLockOnConversionToExclusiveFailure attribute is set to true in the coauthoring subrequest;
2.Multiple clients are in the coauthoring session.

[In SchemaLock Subrequest] Depending on the SchemaLockRequestType attribute value, the protocol server interprets the request as one of the following types of lock operations:

Get lock;

Release lock;

Refresh lock;

Convert to Exclusive lock;

Check lock availability.

[In Get Lock] The protocol server returns an error code value set to "NumberOfCoauthorsReachedMax" when all of the following conditions are true: 
1.The maximum number of coauthorable clients allowed to join a coauthoring session to edit a coauthorable file has been reached;
2.The current client is not allowed to edit the file because the limit has been reached.

[In Release Lock] When the protocol server receives a schema lock subrequest of type "ReleaseLock" from the last and only client editing the document, the protocol server does both of the following:
1.Delete the client identifier entry associated with the client in the file coauthoring tracker; 
2.Delete the coauthoring session and the shared lock on the file if the client that sent the subrequest of type "Release lock" is the last client in the file coauthoring tracker.

[In Convert to Exclusive Lock] The protocol server performs the following operations:
1.The conversion of the shared lock to an exclusive lock.;
2.The deletion of the coauthoring session.

[In Convert to Exclusive Lock] The protocol server returns an error code value set to "ExitCoauthSessionAsConvertToExclusiveFailed" when the following conditions are both true:
1.The ReleaseLockOnConversionToExclusiveFailure attribute is set to true in the coauthoring subrequest;
2.Multiple clients are in the coauthoring session.

[In Appendix B: Product Behavior] [The protocol server MUST follow the following common processing rules for all types of subrequests] The implementation does not return an error code value set to "RequestNotSupported" for a cell storage service subrequest if the following conditions are all true: 

The protocol client sent a coauthoring subrequest;
The protocol server supports shared locking with tracking of the coauthoring transition;
The coauthoring administrator setting for the server is turned off. (Microsoft SharePoint Foundation 2010/Microsoft SharePoint Server 2010 and above follow this behavior.)
